-- ----------------------------
-- Procedure structure for `CalBaseValue`
-- ----------------------------
DROP PROCEDURE IF EXISTS `CalBaseValue`;
DELIMITER ;;
CREATE DEFINER=`homestead`@`%` PROCEDURE `CalBaseValue`()
BEGIN
	#Routine body goes here...
	 DECLARE timestr time;
	 DECLARE prev_key time;
	 DECLARE prev_value double;
	 DECLARE next_key time;
	 DECLARE next_value double;
	 DECLARE b INT;
	 DECLARE i INT;
	 DECLARE ivalue double;
	 DECLARE workdate date;


	 DECLARE cur CURSOR FOR SELECT id ,time, date FROM mobile_mags WHERE mobile_mags.basevalue IS NULL;
   DECLARE CONTINUE HANDLER FOR NOT FOUND SET b = 0;
	 set b =1;

	 OPEN cur;
   label1:LOOP
     FETCH cur INTO i, timestr, workdate;
		 if(b = 0) THEN
				LEAVE label1;

		 END IF;
       SELECT time, basevalue INTO next_key, next_value from base_mags WHERE time > timestr  AND date = workdate ORDER BY time ASC LIMIT 1;
			 SELECT time, basevalue INTO prev_key, prev_value FROM base_mags WHERE time < timestr AND date = workdate ORDER BY time DESC LIMIT 1;

	   if(next_key = prev_key) THEN
		 	set ivalue =  next_value;
	   ELSE
			set ivalue =(next_value - prev_value)/(TIMESTAMPDIFF(SECOND,next_key,prev_key)) * (TIMESTAMPDIFF(SECOND,timestr,prev_key)) + prev_value;
	   END IF;
		     
     UPDATE mobile_mags SET mobile_mags.basevalue = ivalue WHERE id = i;
	

	 End LOOP label1;
	 CLOSE cur;
	 #return icount;
END
;;
DELIMITER ;

