DROP PROCEDURE IF EXISTS `delcords`;
DELIMITER ;;
CREATE DEFINER=`homestead`@`%` PROCEDURE `delcords`()
BEGIN
	#Routine body goes here...
  CREATE TEMPORARY TABLE temp_cords SELECT max(id) as maxid from cords GROUP BY line,station;

  DELETE FROM cords WHERE id not in (SELECT maxid from temp_cords);

	DROP TABLE temp_cords;

  #mobile
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `delmobiles`
-- ----------------------------
DROP PROCEDURE IF EXISTS `delmobiles`;
DELIMITER ;;
CREATE DEFINER=`homestead`@`%` PROCEDURE `delmobiles`()
BEGIN
	#Routine body goes here...
	
	DELETE FROM mobile_mags WHERE mobile_mags.magvalue = 0;
	
	CREATE TEMPORARY TABLE temp_id SELECT mobile_mags.id
	FROM mobile_mags 
	#WHERE (line, station, ext	WHERE line = 
	WHERE line != 0 AND
  mobile_mags.id 
	NOT IN 
	#(SELECT line, station, MAX(ext) FROM mobile_mags WHERE line != 0 GROUP BY line, station)
	(SELECT SUBSTRING_INDEX(GROUP_CONCAT(id ORDER BY ext DESC),',',1) AS id FROM mobile_mags GROUP BY line, station);
	#AND ;

	DELETE from mobile_mags WHERE id in (SELECT id FROM temp_id);
	DROP TABLE temp_id;

	UPDATE mobile_mags SET station = 0 WHERE line = 0;
END
;;
DELIMITER ;

